    false,nt"url": null,nt"notes": "The Digital Geologic Map of the American
    Camp Unit and vicinity, Washington is composed of GIS data layers complete with
    ArcMap 9.2 layer (.LYR) files, two ancillary GIS tables, a Windows Help File with
    ancillary map text, figures and tables, a FGDC metadata record and a 9.2 ArcMap
    (.MXD) Document that displays the digital map in 9.2 ArcGIS. The data were completed
    as a component of the Geologic Resource Evaluation (GRE) program, a National Park
    Service (NPS) Inventory and Monitoring (I&M) funded program that is administered
    by the NPS Geologic Resources Division (GRD). Source geologic maps and data used
    to complete this GRE digital dataset were provided by the following: Washington
    Division of Geology and Earth Resources (WDGER) and the U.S. Geological Survey (USGS).
    Detailed information concerning the sources used and their contribution the GRE
    product are listed in the Source Citation sections(s) of this metadata record (sjis_metadata.txt;
    available at http://nrdata.nps.gov/sajh/nrdata/geology/gis/sjis_metadata.xml). All
    GIS and ancillary tables were produced as per the NPS GRE Geology-GIS Geodatabase
    Data Model v. 2.0. (available at: http://science.nature.nps.gov/im/inventory/geology/GeologyGISDataModel.cfm).
    The GIS data is available as a 9.2 personal geodatabase (sjis_geology.mdb), and
    as shapefile (.SHP) and DBASEIV (.DBF) table files. The GIS data projection is NAD83,
    UTM Zone 10N. That data is within the area of interest of San Juan Island National
    Historical Park.",nt"license_title": null,nt"extras": [{ntt"key":
